import 'dart:convert';
import 'package:flutter/material.dart';
import 'package:flutter_application_1/drowerpag.dart';
import 'package:http/http.dart' as http;

class Instgramprofile extends StatefulWidget {
  const Instgramprofile({super.key});
  @override
  State<Instgramprofile> createState() => _InstgramprofileState();
}

// ignore: prefer_typing_uninitialized_variables
var res;
List<dynamic> lists = [];

class _InstgramprofileState extends State<Instgramprofile> {
  @override
  void initState() {
    testFuture();
    super.initState();
  }

  List<Map<String, String>> stories = [
    {
      'image':
          'data:image/jpeg;base64,',
      'username': 'first day'
    },
    {
      'image':
          'data:image/jpeg;base64,',
      'username': 'My fav day'
    },
    {
      'image':
          'https://th.bing.com/th/id/OIP.XU9NUBJ7b_VKF11rKQTaoAHaFb?w=208&h=153&c=7&r=0&o=5&dpr=1.3&pid=1.7',
      'username': 'Love'
    }
  ];
  void addStory() {
    setState(() {
      stories.add({
        'image':
            'data:image/jpeg;base64,',
        'username': 'New story'
      });
    });
  }

  Future<dynamic> testFuture() async {
    var res = await http
        .get(Uri.parse("https://jsonplaceholder.typicode.com/photos"));
    // ignore: avoid_print
    print(res.body);
    lists = jsonDecode(res.body);
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: const Text("Instagram"),
        centerTitle: true,
        actions: [
          IconButton(
            onPressed: () {},
            icon: const Icon(Icons.notifications),
          ),
          IconButton(
            onPressed: () {},
            icon: const Icon(Icons.h_plus_mobiledata),
          ),
        ],
      ),
      drawer: const defbutt(),
      body: Column(
        children: [
          const Padding(
            padding: EdgeInsets.all(16.0),
            child: Row(
              mainAxisAlignment: MainAxisAlignment.spaceBetween,
              children: [
                CircleAvatar(
                  radius: 40,
                  backgroundImage: NetworkImage(
                      'https://th.bing.com/th/id/OIP.q26tpzRQMV9Hrt01yxuSXgAAAA?w=115&h=180&c=7&r=0&o=5&dpr=1.3&pid=1.7'),
                ),
                Column(
                  children: [
                    Text(
                      'Posts',
                      style: TextStyle(fontWeight: FontWeight.bold),
                    ),
                    Text('5000'),
                  ],
                ),
                Column(
                  children: [
                    Text(
                      'Followers',
                      style: TextStyle(fontWeight: FontWeight.bold),
                    ),
                    Text('10K'),
                  ],
                ),
                Column(
                  children: [
                    Text(
                      'Following',
                      style: TextStyle(fontWeight: FontWeight.bold),
                    ),
                    Text('500'),
                  ],
                ),
              ],
            ),
          ),
          const Padding(
            padding: EdgeInsets.symmetric(horizontal: 16.0),
            child: Row(
              mainAxisAlignment: MainAxisAlignment.start,
              children: [
                Column(
                  crossAxisAlignment: CrossAxisAlignment.start,
                  children: [
                    Text(
                      'Hoda_Hussain',
                      style:
                          TextStyle(fontWeight: FontWeight.bold, fontSize: 18),
                    ),
                    Text('This is the bio of the user.'),
                  ],
                ),
              ],
            ),
          ),
          Column(
            children: [
              Container(
                height: 100,
                child: ListView.builder(
                  scrollDirection: Axis.horizontal,
                  itemCount: stories.length,
                  itemBuilder: (context, index) {
                    return Padding(
                      padding: EdgeInsets.all(8.0),
                      child: Column(
                        children: [
                          CircleAvatar(
                            backgroundImage: NetworkImage(
                              stories[index]['image']!,
                            ),
                            radius: 25,
                          ),
                          SizedBox(height: 5),
                          Text(
                            (stories[index]['username']!),
                          ),
                        ],
                      ),
                    );
                  },
                ),
              ),
              ElevatedButton(
                onPressed: addStory,
                child: Text("Add New Story"),
              ),
            ],
          ),
          FutureBuilder(
            future: testFuture(),
            builder: (context, snapshot) {
              if (snapshot.connectionState == ConnectionState.waiting) {
                return const CircularProgressIndicator();
              } else if (snapshot.hasError) {
                return const Center(
                  child: Text("ERRRRROR"),
                );
              } else {
                return Expanded(
                  child: Padding(
                    padding: const EdgeInsets.all(8.0),
                    // ignore: unnecessary_const
                    child: GridView.builder(
                      itemCount: lists.length, // Number of posts
                      gridDelegate:
                          const SliverGridDelegateWithFixedCrossAxisCount(
                        crossAxisCount: 3,
                        crossAxisSpacing: 8.0,
                        mainAxisSpacing: 8.0,
                      ),
                      itemBuilder: (context, index) {
                        return Container(
                            color: const Color.fromARGB(255, 183, 12, 213),
                            child: Text(
                              "${lists[index]["id"]}",
                              style: const TextStyle(
                                  color: Colors.black, fontSize: 20),
                            ));
                      },
                    ),
                  ),
                );
              }
            },
          ),
        ],
      ),
      bottomNavigationBar: BottomNavigationBar(
        type: BottomNavigationBarType.fixed,
        items: const <BottomNavigationBarItem>[
          BottomNavigationBarItem(
            icon: Icon(Icons.home),
            label: 'Home',
          ),
          BottomNavigationBarItem(
            icon: Icon(Icons.search),
            label: 'Search',
          ),
          BottomNavigationBarItem(
            icon: Icon(Icons.add_box),
            label: 'Add',
          ),
          BottomNavigationBarItem(
            icon: Icon(Icons.video_library),
            label: 'Reels',
          ),
          BottomNavigationBarItem(
            icon: CircleAvatar(
              backgroundImage: NetworkImage(
                  'https://th.bing.com/th/id/OIP.q26tpzRQMV9Hrt01yxuSXgAAAA?w=115&h=180&c=7&r=0&o=5&dpr=1.3&pid=1.7'),
              radius: 15,
            ),
            label: 'Profile',
          ),
        ],
        selectedItemColor: Colors.black,
        unselectedItemColor: Colors.grey,
      ),
    );
  }
}
